import React from "react";
import { Route, Routes } from "react-router-dom";

import Layout from "hoc/layout/layout";
import PollutionTracker from "features/pollutionTracker/component/pollutionTracker";

const App: React.FC = () => {
  return (
    <Layout>
      <Routes>
        <Route path="/" element={<PollutionTracker />} />
      </Routes>
    </Layout>
  );
};

export default App;
